import './App.css';
import axios from 'axios';
import { useState, useEffect } from 'react';
function App() {

  const [people, setPeople] = useStage([])

  useEffect(()=> {
    axios.get('/api').then(res => setPeople(res.data));
  }, []);

  return "hello"
}

export default App;
